import React from "react";
import Typewriter from "react-typewriter-effect";
import Profile from '../Images/Profile.png';
import '../Components/Landing.css';

export default function Landing() {
  return (
    <div className="landing">
      <img src={Profile} alt="profile" className="profile-pic" />
      <div className="text-background">
        <h3 className="landing-header typewriter">
          <Typewriter
            options={{
              strings: ["Hello, I am"],
              autoStart: true,
              loop: false,
            }}
          />
        </h3>
        <h1 className="landing-header-name typewriter">
          <Typewriter
            options={{
              strings: ["Brett Wallin"],
              autoStart: true,
              loop: false,
            }}
          />
        </h1>
        <h2 className="landing-job-title typewriter">
          <Typewriter
            options={{
              strings: ["Full Stack Software Engineer"],
              autoStart: true,
              loop: false,
            }}
          />
        </h2>
        <h3 className="landing-description typewriter">
          <Typewriter
            options={{
              strings: [
                "I am a junior at Illinois State University majoring in computer science.",
                "I am also a passionate software engineer dedicated to continuous learning and growth.",
              ],
              autoStart: true,
              loop: true,
            }}
          />
        </h3>
        <button className="landing-button">Contact Me</button>
      </div>
    </div>
  );
}
